import React, { useState } from 'react';
import { Button } from './SignupButton';

const Signup = () => {
  const [hover, setHover] = useState(false);

  const onHover = () => {
    setHover(!hover);
  };
  return (
    <Button
      to='signup'
      onMouseEnter={onHover}
      onMouseLeave={onHover}
      primary='true'
      dark='true'
      exact='true'
    >
      Create account
    </Button>
  );
};

export default Signup;
